"   <div class=\"block pha drugH1Div\" id=\"F229583\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Tramadol and its active metabolite (M1) binds to &mu;-opiate receptors in the CNS causing inhibition of ascending pain pathways, altering the perception of and response to pain; also inhibits the reuptake of norepinephrine and serotonin, which also modifies the ascending pain pathway",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F229600\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset of action: Immediate release: ~1 hour",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Duration: 9 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Immediate release formulation: Rapid and complete; Extended release formulation: Delayed",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     : 2.5-3 L/kg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding, plasma: ~20%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Extensively hepatic via demethylation (mediated by CYP3A4 and CYP2B6), glucuronidation, and sulfation; has pharmacologically active metabolite formed by CYP2D6 (M1; O-desmethyl tramadol)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: Immediate release: 75%; Extended release: Ultram&reg; ER: 85% to 90% (as compared to immediate release), Zytram&reg; XL, Tridural&trade;: 70%, Ryzolt&trade;: ~95% (as compared to immediate release)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: Tramadol: ~6-8 hours; Active metabolite: 7-9 hours; prolonged in elderly, hepatic or renal impairment; Zytram&reg; XL: Apparent half-life: ~16 hours; Durela&trade;, Ralivia&trade;, Ryzolt&trade;, Tridural&trade;: ~5-9 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak: Immediate release: ~2 hours; Extended release: ConZip&trade;: ~10-12 hours, Ryzolt&trade;, Tridural&trade;: ~4 hours; Durela&trade;, Ultram&reg; ER: ~12 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (30% as unchanged drug; 60% as metabolites)",
"    </p>",
"   </div>",
