var title_f41_50_42798="Circadian hormones in asthma";
var content_f41_50_42798=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F53078&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F53078&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 580px\">",
"   <div class=\"ttl\">",
"    Circadian changes in hormone levels in asthma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 560px; height: 321px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Mean changes in peak expiratory flow rate (PEFR) and the plasma concentrations of cortisol, epinephrine, cyclic AMP, and histamine over a 24-hour period in patients with nocturnal asthma. The nadir in PEFR, which occurs at 4 AM, is associated with low levels of cortisol and epinephrine and high levels of the bronchoconstrictor mediator, histamine.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Redrawn from Barnes, P, Fitzgerald, G, Brown, M, N Engl J Med 1980; 303:263.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
